import React, { useState } from 'react';
import { Tab, Nav, Modal, Button } from 'react-bootstrap';

const Profile = () => {
  const [showLoginModal, setShowLoginModal] = useState(false);

  const handleShowLoginModal = () => setShowLoginModal(true);
  const handleCloseLoginModal = () => setShowLoginModal(false);

  return (
    <div>
      {/* breadcrumb-area start */}
      <div className="breadcrumb-area">
        {/* ... ваш код для хлебных крошек */}
      </div>
      {/* breadcrumb-area end */}
      
      {/* account area start */}
      <div className="account-dashboard pt-100px pb-100px">
        <div className="container">
          <div className="row">
            <div className="col-sm-12 col-md-3 col-lg-3">
              {/* Nav tabs */}
              <div className="dashboard_tab_button" data-aos="fade-up" data-aos-delay="0">
                <Nav className="flex-column dashboard-list" role="tablist">
                  <Nav.Item>
                    <Nav.Link href="#orders">Orders</Nav.Link>
                  </Nav.Item>
                  <Nav.Item>
                    <Nav.Link href="#address">Address</Nav.Link>
                  </Nav.Item>
                  <Nav.Item>
                    <Nav.Link href="#account-details">Account details</Nav.Link>
                  </Nav.Item>
                  <Nav.Item>
                    <Nav.Link onClick={handleShowLoginModal}>Logout</Nav.Link>
                  </Nav.Item>
                </Nav>
              </div>
            </div>
            <div className="col-sm-12 col-md-9 col-lg-9">
              {/* Tab panes */}
              <Tab.Content className="dashboard_content" data-aos="fade-up" data-aos-delay="200">
                <Tab.Pane eventKey="#orders">
                  {/* ... ваш код для вкладки "Orders" */}
                </Tab.Pane>
                <Tab.Pane eventKey="#address">
                  {/* ... ваш код для вкладки "Address" */}
                </Tab.Pane>
                <Tab.Pane eventKey="#account-details">
                  {/* ... ваш код для вкладки "Account details" */}
                </Tab.Pane>
              </Tab.Content>
            </div>
          </div>
        </div>
      </div>
      {/* account area end */}

      {/* Модальное окно для выхода из аккаунта */}
      <Modal show={showLoginModal} onHide={handleCloseLoginModal}>
        <Modal.Header closeButton>
          <Modal.Title>Logout</Modal.Title>
        </Modal.Header>
        <Modal.Body>Are you sure you want to logout?</Modal.Body>
        <Modal.Footer>
          <Button variant="secondary" onClick={handleCloseLoginModal}>
            Close
          </Button>
          {/* Добавьте здесь логику для выхода из аккаунта */}
          <Button variant="primary" onClick={handleCloseLoginModal}>
            Logout
          </Button>
        </Modal.Footer>
      </Modal>
    </div>
  );
};

export default Profile;
